import React from 'react';
import '.icketCard.css';

const TicketCard = ({ ticket }) => {
  return (
    <div className="ticket-card">
      <h3>{ticket.title}</h3>
      <p>Status: {ticket.status}</p>
      <p>Priority: {ticket.priority}</p>
      {/* Add more details as needed */}
    </div>
  );
};

export default TicketCard;
